import { UserNav } from "../Navbar/homeNav"
import { getPrinter,getPrinters } from "../../data/data"

export default function MyPrinters(){

    const printers=getPrinters();
    return(
        <div className="containerMyprinters">
            <UserNav/>

            <h2>My printers</h2>
            <div className="printerTable">
                <table>
                    <tr>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Seleziona</th>
                    </tr> 
                        {printers.map((elem)=>{
                            <tr><td>{elem.name}</td></tr>

                        })}

                        {printers.map((elem)=>{
                            <tr><td>{elem.address}</td></tr>

                        })}

                        {printers.map((elem)=>{
                            <tr><td><button id={elem.address}className="printButton">Seleziona</button></td></tr>

                        })}

                </table>
            </div>
        </div>
    )
}
